import React from "react";

const Result = ({ userInfo }) => {
    return (
    <div>
        <img src="userInfo.avator_url" alt="" />
        <h3>(userInfo.name</h3>
        <h4>(userInfo.name</h4>
        <p>(userInfo.name</p>
        <a href={userInfo.url}>VIsit Github</a>
        <ul>
            <li>
                <Strong> Followers</Strong>
                {userInfo.followers}
            </li>
            <li>
                <Strong> Followers</Strong>
                {userInfo.followeing}
            </li>
            <li>
                <Strong> Followers</Strong>
                {userInfo.public_rsepos}
            </li>

        </ul>

    </div>

    )};

export default Result;
